var c={conjugar:function(r,n){if(0==r.length)return"not found";for(var e in regular[n])for(var u in regular[n][e])if(r===u)return regular[n][e][u];return c.conjugar(r.slice(1,r.length),n)},conjugacion:function(r){return r[r.length-2]+r[r.length-1]},raiz:function(r){return r.slice(0,r.length-2)},tipo:{ar:"Primera Conjugación",er:"Segunda Conjugación",ir:"Tercera Conjugación"},parse:function(r,n,e){var u=regular[r][n][e].split("#"),a=c.tipo[r]+", "+u[0]+"ª Persona del "+u[2]+", "+u[1]+" de "+n;return a}};